('Certificate Request Creation','2022-06-03 11:02:34.579145','2024-07-10 15:51:03.429317','Administrator','Administrator',0,0,1,1,'LMS','Email',NULL,'Your evaluation slot has been booked','New','LMS Certificate Request',NULL,NULL,0,NULL,NULL,0,NULL,NULL,NULL,NULL,0,'HTML','{% set title = frappe.db.get_value(\"LMS Course\", doc.course, \"title\") %}\n{% set timezone = frappe.db.get_value(\"LMS Batch\", doc.batch, \"timezone\") %}\n{% set timezone = timezone if timezone else \'\' %}\n{% set evaluator_name = frappe.db.get_value(\"User\", doc.evaluator, \"full_name\") %}\n\n<p> {{ _(\"Hey {0}\").format(doc.member_name) }} </p>\n<p> {{ _(\'Your evaluation for the course {0} has been scheduled on {1} at {2} {3}.\').format(title, frappe.utils.format_date(doc.date, \"medium\"), frappe.utils.format_time(doc.start_time, \"short\"), timezone) }}</p>\n<p> {{ _(\"Your evaluator is {0}\").format(evaluator_name) }}\n<p> {{ _(\"Please prepare well and be on time for the evaluations.\") }} </p>\n',0,NULL,NULL,NULL,NULL,NULL),
('Certificate Request Reminder','2022-06-03 11:51:02.681803','2024-07-10 15:51:33.803704','Administrator','Administrator',0,0,1,1,'LMS','Email',NULL,'Reminder for Certificate Evaluation','Days Before','LMS Certificate Request',NULL,'date',1,NULL,NULL,0,NULL,NULL,NULL,NULL,0,'HTML','{% set title = frappe.db.get_value(\"LMS Course\", doc.course, \"title\") %}\n{% set timezone = frappe.db.get_value(\"LMS Batch\", doc.batch, \"timezone\") %}\n{% set timezone = timezone if timezone else \'\' %}\n{% set evaluator_name = frappe.db.get_value(\"User\", doc.evaluator, \"full_name\") %}\n\n<p> {{ _(\'Your evaluation for the course {0} has been scheduled on {1} at {2} {3}.\').format(title, frappe.utils.format_date(doc.date, \"medium\"), frappe.utils.format_time(doc.start_time, \"short\"), timezone) }}</p>\n<p> {{ _(\"Your evaluator is {0}\").format(evaluator_name) }}\n<p> {{ _(\"Please prepare well and be on time for the evaluations.\") }} </p>\n',0,NULL,NULL,NULL,NULL,NULL),
('New job alert','2021-12-30 12:29:56.533903','2021-12-30 12:54:13.382512','Administrator','Administrator',0,0,1,1,'Job','Email',NULL,'New job added by {{ doc.company_name}}','New','Job Opportunity',NULL,NULL,0,NULL,NULL,0,'',NULL,NULL,NULL,0,NULL,'Hey,\n\nA new Job Opportunity has been created. \n\n<p>Company Name: {{ doc.company_name}}</p>\n<p>Job Title: {{ doc.job_title}}</p>\n<p>Job Location: {{ doc.location}}</p><br>\n<p>Job Description: {{ doc.description}}</p><br>\n\n<p>Find all the posted jobs  <a href=\"{{ frappe.utils.get_url() }}/app/job-opportunity\">here</a>.</p><br>\n',0,NULL,NULL,NULL,NULL,NULL);
